import React from "react";

const ViewTenant = ({ tenantData }) => {
  if (!tenantData)
    return <h3 style={{ textAlign: "center", marginTop: 50 }}>No tenant data available</h3>;

  const formatDate = (d) => (d ? d.split("T")[0] : "");

  const fields = [
    "tenant_id",
    "tenant_name",
    "tenant_dob",
    "tenant_nationality",
    "tenant_passport_number",
    "tenant_emirates_id",
    "tenant_passport_expiry_date",
    "tenant_eid_expiry_date",
    "tenant_employer",
    "tenant_mobile_number",
    "tenant_email_id",
  ];

  return (
    <div style={{ fontFamily: "Arial", padding: 20, background: "#f5f6fa" }}>
      <h2 style={{ textAlign: "center", background: "#2f3640", color: "white", padding: 15 }}>
        View Tenant
      </h2>
      <div
        style={{
          background: "white",
          maxWidth: "900px",
          margin: "20px auto",
          padding: "20px",
          borderRadius: "10px",
          boxShadow: "0 0 10px #ccc",
        }}
      >
        {fields.map((f) => (
          <div key={f} style={{ marginBottom: 10 }}>
            <label style={{ fontWeight: "bold" }}>{f.replace(/_/g, " ").toUpperCase()}</label>
            <input
              type={f.includes("date") ? "date" : "text"}
              value={formatDate(tenantData[f]) || tenantData[f] || ""}
              readOnly
              style={{
                display: "block",
                width: "100%",
                padding: 8,
                borderRadius: 6,
                border: "1px solid #ccc",
                background: "#f0f0f0",
              }}
            />
          </div>
        ))}
        <div style={{ textAlign: "center", marginTop: 20 }}>
          <a
            href="/index"
            style={{
              padding: "10px 20px",
              backgroundColor: "#492bc0ff",
              color: "white",
              borderRadius: 6,
              textDecoration: "none",
            }}
          >
            ‚Üê Go Back Home
          </a>
        </div>
      </div>
    </div>
  );
};

export default ViewTenant;
